import React from 'react'

const Shopping = (props) => {
  return (
    <>
       {props.products.map((product, index) => (
            <div className='justify-content-start m-3 col col-md-2 col-sm-4 col-lg-2 video-block'>
                <h1>{product}</h1>
            </div>
        ))}
    </>
    )
}

export default Shopping;
